import LoginPage from './files/loginpage';
import Signup from './files/signup';
import { BrowserRouter, Route } from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
      <Route exact path="/" component={LoginPage}/>
      <Route exact path="/signup" component={Signup}/>
    </BrowserRouter>
  );
}

export default App;
